import './style.css'

function Div1(){
    return (
        <div className="div">
        <div className="coluna1 texto">
           <h1> Coluna 1 / Linha 1 </h1>
       </div>
       <div className="coluna2 texto">
           <h1> Coluna 2 / Linha 1 </h1>
       </div>
       <div className="coluna3 texto">
           <h1> Coluna 3 / Linha 1 </h1>
       </div>
      </div>
    );
}

export default Div1;
